import React , { Component }  from 'react';
import Fade from 'react-reveal/Fade';

class Immigration extends Component {
    render(){
        return(
            <div>
            <p className="head"><strong>Immigration</strong></p>
            <h2 className=" head text-center mx-auto p-1 mt-1 best">
            <a href="https://www.canada.ca/en/immigration-refugees-citizenship/corporate/publications-manuals/operational-bulletins-manuals/standard-requirements/language-requirements/test-equivalency-charts.html
                " target="_blank" ><strong>Language Test Equivalency Charts</strong></a>

            </h2>
            <div className="service">
                <ul className="responsive  mx-auto p-1 mt-1 text-justify" >
                <Fade left appear><p className="para"> Part of the immigration process is taking a Language Proficiency Test.  Scores are converted to the Canadian Language Benchmarks and points can be awarded depending on the immigration stream.  
            <br/> <br/>
           <strong>NOTE: </strong> A TRV does not guarantee that the Officer at the Canadian Port of Entry will entry into Canada. At the Port of Entry, all guests must show that the reason for their visit to Canada is temporary. Officers at the Port of Entry will deny admission to all people who they believe do not plan to leave Canada at the expiry of their authorized stay in Canada.

                         </p></Fade>

                </ul>
                </div>
            </div>
        );
    }
}
export default Immigration;
